  `license` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '车牌号',
  `parkingLotInformationId` bigint(30) NULL DEFAULT NULL COMMENT '停车场id',
  `admissionTime` datetime NOT NULL COMMENT '入场时间',
  `exitTime` datetime NULL DEFAULT NULL COMMENT '出场时间',
  `licensePllateColor` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '车牌颜色',
  `orderNumber` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '订单编号',
  `orderState` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '订单状态0代表未支付1代表已支付2代表正在支付',
  `payState` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '支付状态0代表未支付1代表已支付',
  `money` bigint(12) NULL DEFAULT NULL COMMENT '实际支付金额',
  `entranceAndExitName` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '出入口名称',
  `payTime` datetime NULL DEFAULT NULL COMMENT '支付时间',
  `numberTwo` varchar(20000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '进场图片',
  `numberThree` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '出场图片',
  `discountAmount` bigint(12) NULL DEFAULT NULL COMMENT '优惠金额',
  `amountPayable` bigint(12) NULL DEFAULT NULL COMMENT '应缴金额',
  `paymentMethod` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '支付方式',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `licens`(`license`) USING BTREE,
  INDEX `parkingLotInformationI`(`parkingLotInformationId`) USING BTREE,
  INDEX `patsta`(`payState`) USING BTREE,
  INDEX `orderStat`(`orderState`) USING BTREE,
  INDEX `payTim`(`payTime`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 185 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '停车记录' ROW_FORMAT = Dynamic;

